import { useCookies } from "react-cookie";
import { useNavigate } from "react-router-dom";
import { useEffect,useState } from "react";
import axios from "axios";

function Home(){
    const [cookies, setCookie] = useCookies();
    const [name,setName] = useState("");
    const navigate = useNavigate();
    const [people,setPerson] = useState([]);

    useEffect(()=>{
        if(cookies.username===undefined) {
            navigate('/');
        }
        axios.get('http://localhost:4000/authenticate',{ headers: {"Authorization" : `Bearer ${cookies.username}`}}).then(response=>{
            console.log(people);
        }).catch(err=>{
            console.log(err);
            navigate("/");
        })
    },[cookies.username]);

    useEffect(()=>{
        if(name.length>0) {
            axios.post('http://localhost:4000/getartists',{
                name : name
            }).then(response=>{
                console.log(response['data']);
                for(let i = 0;i<response['data'].length;++i) {
                    setPerson(oldArr=>{[...oldArr,{username : response['data'][i]['username']}]})
                }
                console.log(people);
            }).catch(err=>{
                console.log(err);
            })
        }
    },[name]);

    // console.log(people);

    return <div>
        <input placeholder="Type Name" onChange={(e)=>{setName(e.target.value)}}></input>
    </div>
}

export default Home;
